INSERT INTO `glpi_plugin_resources_contracttypes` VALUES (1,0,0,'CDI-OpenEnded',1,1,1,'The open-ended employment contract (or CDI) is the normal form of employment contract between an employer and an employee, and has no fixed term. Employers must therefore use this type of contract unless they can prove that they are in a situation allowing another type of contract (fixed term contract, interim employee supply contract).\r\n\r\nThe contract may be concluded in writing or it may be the result of a verbal agreement between the employer and the employee for full-time open-ended employment contracts (unless specified otherwise by the provisions of law or branch agreements). However, the employer must inform the employee in writing of the essential points of the employment relationship: the identity of the two parties, the place of work, the position to be taken up and the pay.\r\n\r\nThe probationary period that is often provided for by branch agreement is contained in a specific clause of the contract. It is only valid if it is put in writing, and if the principle and the duration of the said period are set as soon as the employee is recruited.'),(2,0,0,'CDD - Interim',1,1,1,''),(3,0,0,'Trainee',1,1,1,'');
/*!40000 ALTER TABLE `glpi_plugin_resources_contracttypes` ENABLE KEYS */;
UNLOCK TABLES;

